function App() {

  return (
    <div className="App">
      <Navbar />
      <Portfolio />
      <video className="Work-Gif"  loop="true" autoplay="autoplay" muted>
                    <source src={project.gif} type="video/mp4" />
        </video>
    </div>
  );
};

export default App;
